class Mahabote{constructor(t,r,h,o,e,a){this.year=t,this.month=r,this.day=h,this.hour=o,this.minute=e,this.second=a}calcJD(){var t=Math.floor((14-this.month)/12),r=this.year+4800-t,t=this.month+12*t-3;return this.day+Math.floor((153*t+2)/5)+365*r+Math.floor(r/4)-Math.floor(r/100)+Math.floor(r/400)-32045}get_mmYear(){return Math.floor((this.calcJD()-.5-1954168.050623)/365.2587565)}getHouse(){return["ဘင်္ဂ","အထွန်း","ရာဇ","အဓိပတိ","မရဏ","သိုက်","ပုတိ"][(this.getModulo()+7-this.getDayNumber())%7]}getModulo(){return this.get_mmYear()%7}getDayNumber(){return(this.calcJD()-5)%7}getDayString(){return["စနေ","တနင်္ဂနွေ","တနင်္လာ","အင်္ဂါ","ဗုဒ္ဓဟူး","ကြာသပတေး","သောကြာ"][(this.calcJD()-5)%7]}}